import React from 'react';
import { motion } from 'framer-motion';
import { ArrowRight, Cpu, Brain } from 'lucide-react';

const Hero = () => {
  return (
    <section className="hero">
      <div className="container">
        <motion.div 
          className="hero-content"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <motion.h1 
            className="hero-title"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            Browse everything.
          </motion.h1>

          <motion.div 
            className="hero-visual"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
          >
            <div className="tablet-device">
              <div className="tablet-screen">
                <div className="screen-content">
                  <div className="screen-header">
                    <span className="breadcrumb">Reports {'>'}{' '}Overview</span>
                    <div className="filter-button">
                      <span>All Regions (33)</span>
                      <ArrowRight size={12} />
                    </div>
                  </div>
                  <div className="metric-display">
                    <div className="metric-value">78%</div>
                    <div className="metric-label">Efficiency Improvements</div>
                  </div>
                  <div className="timeline">
                    <span>2021</span>
                    <span>2022</span>
                    <span>2023</span>
                    <span>2024</span>
                  </div>
                  <div className="data-visualization">
                    <div className="data-bar" style={{ height: '60%' }}></div>
                    <div className="data-bar" style={{ height: '80%' }}></div>
                    <div className="data-bar" style={{ height: '45%' }}></div>
                    <div className="data-bar" style={{ height: '90%' }}></div>
                  </div>
                </div>
              </div>
            </div>
          </motion.div>

          <motion.div 
            className="hero-actions"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.8 }}
          >
            <a href="#features" className="btn btn-primary">
              Learn More
              <ArrowRight size={16} />
            </a>
          </motion.div>
        </motion.div>
      </div>

      <style jsx>{`
        .hero {
          min-height: 100vh;
          display: flex;
          align-items: center;
          position: relative;
          background: #ffffff;
          text-align: center;
          padding: 120px 0;
        }

        .hero-content {
          max-width: 1000px;
          margin: 0 auto;
        }

        .hero-title {
          font-family: 'Georgia', 'Times New Roman', serif;
          font-size: 5rem;
          font-weight: 400;
          color: #1a202c;
          margin-bottom: 100px;
          line-height: 1.05;
          letter-spacing: -0.025em;
        }

        .hero-visual {
          margin-bottom: 80px;
          display: flex;
          justify-content: center;
        }

        .tablet-device {
          width: 450px;
          height: 320px;
          background: #000000;
          border-radius: 24px;
          padding: 10px;
          box-shadow: 0 25px 50px rgba(0, 0, 0, 0.15);
          transform: rotate(-8deg);
        }

        .tablet-screen {
          width: 100%;
          height: 100%;
          background: linear-gradient(135deg, #87CEEB 0%, #98FB98 100%);
          border-radius: 14px;
          padding: 24px;
          position: relative;
          overflow: hidden;
        }

        .screen-content {
          height: 100%;
          display: flex;
          flex-direction: column;
          justify-content: space-between;
        }

        .screen-header {
          display: flex;
          justify-content: space-between;
          align-items: center;
          margin-bottom: 30px;
        }

        .breadcrumb {
          font-size: 0.75rem;
          color: rgba(255, 255, 255, 0.8);
          font-weight: 400;
        }

        .filter-button {
          display: flex;
          align-items: center;
          gap: 6px;
          background: rgba(255, 255, 255, 0.2);
          padding: 8px 16px;
          border-radius: 24px;
          font-size: 0.75rem;
          color: rgba(255, 255, 255, 0.9);
          font-weight: 500;
        }

        .metric-display {
          text-align: center;
          margin-bottom: 30px;
        }

        .metric-value {
          font-family: 'Georgia', 'Times New Roman', serif;
          font-size: 3rem;
          font-weight: 400;
          color: rgba(255, 255, 255, 0.9);
          margin-bottom: 8px;
        }

        .metric-label {
          font-size: 0.85rem;
          color: rgba(255, 255, 255, 0.8);
          font-weight: 400;
        }

        .timeline {
          display: flex;
          justify-content: space-between;
          margin-bottom: 20px;
        }

        .timeline span {
          font-size: 0.65rem;
          color: rgba(255, 255, 255, 0.7);
          font-weight: 400;
        }

        .data-visualization {
          display: flex;
          justify-content: space-between;
          align-items: flex-end;
          height: 80px;
          gap: 12px;
        }

        .data-bar {
          flex: 1;
          background: rgba(255, 255, 255, 0.8);
          border-radius: 3px;
          position: relative;
        }

        .data-bar::after {
          content: '';
          position: absolute;
          top: -6px;
          left: 50%;
          transform: translateX(-50%);
          width: 10px;
          height: 10px;
          background: rgba(255, 255, 255, 0.9);
          border-radius: 50%;
        }

        .hero-actions {
          display: flex;
          justify-content: center;
        }

        @media (max-width: 768px) {
          .hero {
            padding: 80px 0;
          }

          .hero-title {
            font-size: 3.5rem;
            margin-bottom: 80px;
          }

          .tablet-device {
            width: 350px;
            height: 250px;
          }

          .metric-value {
            font-size: 2.5rem;
          }
        }

        @media (max-width: 480px) {
          .hero-title {
            font-size: 3rem;
            margin-bottom: 60px;
          }

          .tablet-device {
            width: 280px;
            height: 200px;
          }

          .metric-value {
            font-size: 2rem;
          }
        }
      `}</style>
    </section>
  );
};

export default Hero;
